    header .searchform:has(.sb-search-open) {
        width: 100%;
        transition: width .3s;
    }

    header .searchform {
        transition: width .3s;
        width: 20px;
    }

    header .soound_button h1 {
        color: #fff;
        text-wrap: nowrap;
        font-size: 25px;
        line-height: normal;
        font-family: Arial, Helvetica, sans-serif;
        font-style: italic;
        font-weight: 700;
        margin-right: 20px;
        margin-left: 10px;
        margin-bottom: 0;
    }

    header .soound_button i {
        font-size: 42px;
    }

    header .right_header {
        display: flex;
        align-items: center;
        width: 100%;
        justify-content: end;
        max-width: 600px;
    }

    header .soound_button {
        display: flex;
        align-items: center;
        cursor: pointer;
    }

    @media only screen and (max-width:1366px) {
        header .soound_button h1 {
            font-size: 16px;
        }

        header .soound_button i {
            font-size: 32px;
        }

        header .right_header {
            max-width: 400px;
        }

        @media only screen and (max-width:991px) {
            body.logo-hide .soound_button {
                display: none;
            }

            header .searchform {
                margin-right: 0;
            }

            header .searchform {
                padding-right: 0;
                padding-top: 5px;
            }

            header .sb-search .sb-icon-search {
                width: 16px;
                padding: 0;
            }

            header .soound_button h1 {
                display: none;
            }

            header .soound_button {
                position: absolute;
                top: 0;
                right: 15%;
                z-index: 99;
            }
        }

        @media only screen and (max-width:767px) {
            header .soound_button {
                right: 22%;
                top: 5px;
            }

            header .soound_button i {
                font-size: 22px;
            }
        }
    }
